          amount={props.list[3].amount}
          date={props.list[3].date}
        ></ExpenseItem>
        <ExpenseItem
          title={props.list[4].title}
          amount={props.list[4].amount}
          date={props.list[4].date}
        ></ExpenseItem>
      </div>
    </div>
  );
}

export default Expenses;
